                <button className="btn1 big-button" value='tecnologia' > Tecnologia</button>
                <button className="btn1 big-button" value='musica'>Musica</button>
                <button className="btn1 big-button" value='videogiochi'> Videogiochi</button>
                <button className="btn1 big-button" value='film'>Film-SerieTv</button>
                <button className="btn1 big-button" value='consigli'>Consigli</button>
            </div>
        </div>
    </section>
        )
}

export default Button;
